import React from 'react'
import { useContext } from 'react'
import {dis} from './App';

export default function C1() {
    const Dis = useContext(dis);
    return (
        <div>
            <h3>{dis.CountState}</h3>
            <button onClick = {()=>Dis.CountDispatch('increment')}>Increment</button>
            <button onClick = {()=>dis.CountDispatch('decrement')}>Decrement</button>
            <button onClick = {()=>dis.CountDispatch('reset')}>Reset</button>
        </div>
    )
}
